import React from 'react'
import '../navigation.css'
import NavBar from '../components/NavBar'
import { Link, NavLink, useMatch, useResolvedPath } from 'react-router-dom'
import styled from "styled-components";

// const CustomLink = styled(Link)`
//   color: Blue;
//   text-decoration: none;
//   margin: 1rem;
//   position: relative;
// `;

const NavUnlisted = styled.ul`

  display: flex;

  a {
    text-decoration: none;
  }

  li {
    color: red;
    margin: 0 0.8rem;
    font-size: 1.3rem;
    position: relative;
    list-style: none;
  }

  .current {
    li {
      border-bottom: 2px solid black;
    }
  }
`;


export default function FAQ() {
  return (
    <div className='page'>
        {/* <NavBar pressed={2}/>
        content
        <CustomLink to={'/faq'}>go</CustomLink> */}

    <NavUnlisted>
      <NavLink to="/expl" activeClassName="current" exact>
        <li>Explore</li>
      </NavLink>
      <NavLink to="/faqd" activeClassName="current" exact>
        <li>FAQ</li>
      </NavLink>
    </NavUnlisted>

    </div>
  )
}
